syntax = "proto3";
package QuestionnaireStruct;
message ProtoAdapter_QuestionnaireStruct {
	string background_url = 10;
	string extra = 9;
	string fe_data = 6;
	bool is_expired = 2;
	bool is_popped = 4;
	int32 pop_up_max_progress = 12;
	int32 pop_up_min_progress = 11;
